window.bookSummaryJSON = "<b>I only wanted to help women find justice, I didn’t expect to be targeted by a killer!</b><br><br>Women are being targeted on campus, and the campus police are barely pretending to investigate. No way am I going to let that stand. But when I stick my nose into the investigation, I end up the target of a killer.<br><br>When my bakery buddies Callie and Anna discover what I’ve been up to, they are ready to jump headfirst into the investigation. They are not going to be happy when they discover the secrets I’ve been keeping. No one can stop Callie and Anna when their minds are made up, though.<br><br>Will we find the killer before he hits the bull-eyes on my back? Click <b>BUY NOW</b> to find out!<br><br>Cupcakes not included, although there is one seriously yummy Grasshopper Cake.<br><br><i>Each book in the Death by Cupcake series can be read as a standalone, although they're way more fun if read in order.</i><br><br>Warning: Although there are plenty of moments that will make you shake your head and laugh at the antics of the ladies of Callie's Cakes, the subject matter - rape on college campuses - is very real and somewhat darker than your usual cozy mystery."; 
